import 'antd/dist/antd.css';
import CustomLayout from './containers/Layout';
import BaseRouter from './routes'
import { BrowserRouter as Router } from 'react-router-dom';


function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <CustomLayout>
          <BaseRouter/>
        </CustomLayout>
      </BrowserRouter>

    </div>
  );
}

export default App;
